Just Sprinting','','','','','','','','Number of Employees','What is your GitHub username?','How do you categorize your organization?','','','Pick-list','Text area required','Pick-list','','','False','','Application Type','Do not ask','Ask','Do not ask','Do not ask','False','Do not ask','Do not ask','Ask mobile and require','Do not ask','Ask','Ask','Do not ask','Do not ask','','Ask','General Public','','0.0','','Company or Organization','Standard Contact Duplicate Rule','Full matching contact creation with duplicate management','Match with most recently modified','Create Contact','Use Salesforce Duplicate Rule','Admissions','','Date of Birth','False','False','False','','','','Email','2024-10-01','','','Selected options','','Once you have made your selections click next.','','','Choose your options','','','','','','','Event Cost','Event Charges','Total','','Payments Received','<p><span style="color: rgb(68, 68, 68);"><img src="https://computing-page-4325-dev-ed.scratch.file.force.com/servlet/rtaImage?eid=a0BDE00000Mmsog&amp;feoid=00NDE00000zuPHi&amp;refid=0EMDE000000W7fA" alt="image.png"></img></span></p>','<p>This Event&#39;s Registration is now CLOSED. Get ready to Sprint on the next one! We&#39;ll miss you.</p>','','Event Home','','Open Source Sprint Event','','Payment Due','','Payment Received','Open Source Sprint Event','','','','','Info Session','<p><span style="font-size: 16px;"><img src="https://computing-page-4325-dev-ed.scratch.file.force.com/servlet/rtaImage?eid=a0BDE00000Mmsog&amp;feoid=00NDE00000zuPHy&amp;refid=0EMDE000000W8Ww" alt="image.png"></img></span></p><p><br></p><p><span style="font-size: 16px;">﻿Get ready to rock the Windy City with </span><strong style="font-size: 16px; color: rgb(0, 158, 219);">Salesforce</strong><span style="font-size: 16px;">&#39;s</span><strong style="font-size: 16px;"> </strong><span style="font-size: 16px;">tech extravaganza! &#127788;️ Join us at the </span><strong style="font-size: 16px;">Salesforce Commons Sprint </strong><span style="font-size: 16px;">event in the heart of Chicago. &#127961;️</span></p><p><br></p><p><span style="font-size: 16px; color: rgb(0, 0, 0);">The Sprint is not just another event – it&#39;s your ticket to tech-tastic fun, and it&#39;s totally free! Whether you&#39;re a beginner or a Salesforce ninja, there&#39;s something for everyone at the Sprint. &#128640; You&#39;ll learn from Salesforce experts, rub shoulders with like-minded tech enthusiasts, and even get</span><span style="font-size: 16px;"> a chance to create something that truly rocks! &#129302;&#127881;</span></p><p><br></p><p><span style="font-size: 16px;">Imagine a tech playground where innovation knows no bounds. Our Sprints are like community innovation parties (think hack-a-thon meets carnival) designed to unite Salesforce partners, customers, and our amazing employee volunteers. Together, we brainstorm, prioritize, and build solutions that make using Salesforce a breeze, especially for nonprofit &amp; education organizations. &#129504;&#127905;</span></p><p><br></p><p><span style="font-size: 16px;">Come for the knowledge, stay for the thrill! Connect, learn, and supercharge your Salesforce expertise with the coolest crowd in the industry. Whether you&#39;re a tech newbie or a seasoned pro, this sprint is your backstage pass to a tech party like no other. &#128378;&#128131;</span></p><p><br></p><p><span style="font-size: 16px;">Don&#39;t miss your chance to ride the innovation wave! &#127754;</span></p><p><span style="font-size: 16px;">Save the date, grab your tech gear, and stay tuned for more juicy details. See you in Chicago, where tech dreams come true! &#127880;&#127775;</span></p><p><br></p><p><span style="font-size: 16px;">Ready to have a blast and make a difference at the </span><strong style="font-size: 16px;">October Nonprofit &amp; Education Community Sprint</strong><span style="font-size: 16px;">? Register below, and let&#39;s get this tech party started! &#127882;&#128640;&#128187;</span></p><p><br></p><p style="text-align: center;"><img src="https://computing-page-4325-dev-ed.scratch.file.force.com/servlet/rtaImage?eid=a0BDE00000Mmsog&amp;feoid=00NDE00000zuPHy&amp;refid=0EMDE000000W7n1" alt="image.png"></img> <img src="https://computing-page-4325-dev-ed.scratch.file.force.com/servlet/rtaImage?eid=a0BDE00000Mmsog&amp;feoid=00NDE00000zuPHy&amp;refid=0EMDE000000W7n6" alt="image.png"></img></p><p><strong style="font-size: 16px;">What is a Sprint?</strong><span style="font-size: 16px;"> The Sprint is a hack-a-thon type event, where you will contribute your skills in small breakout groups and work with others, to discuss different Salesforce technology challenges.</span></p><p><span style="font-size: 16px;"> </span></p><p><span style="font-size: 16px;">Connect and collaborate with your peers to build solutions to common challenges prioritised by you and the community. </span></p><p><span style="font-size: 16px;"> </span></p><p><strong style="font-size: 16px;">Who should attend?</strong><span style="font-size: 16px;"> Register if you&#39;re an </span><strong style="font-size: 16px;">Admin</strong><span style="font-size: 16px;">, </span><strong style="font-size: 16px;">Developer</strong><span style="font-size: 16px;">, </span><strong style="font-size: 16px;">Consultant</strong><span style="font-size: 16px;">, or </span><strong style="font-size: 16px;">End-User </strong><span style="font-size: 16px;">in the </span><u style="font-size: 16px;">Nonprofit</u><span style="font-size: 16px;"> or </span><u style="font-size: 16px;">Education</u><span style="font-size: 16px;"> Salesforce community.</span></p><p style="text-align: center;"><br></p><p style="text-align: center;"><br></p><p style="text-align: center;"><strong style="color: rgb(0, 158, 219); font-size: 16px;">Meet the Team</strong></p><p style="text-align: center;"><img src="https://computing-page-4325-dev-ed.scratch.file.force.com/servlet/rtaImage?eid=a0BDE00000Mmsog&amp;feoid=00NDE00000zuPHy&amp;refid=0EMDE000000W8X1" alt="image.png"></img></p>','Register','','','First Name','Gender','','','','','','False','Cancel','Continue','You have unsaved Guest information entered. Select Cancel to finish adding your guests.','Touchpoint','False','','','','','','','','','','','','','','','','True','Last Name As Student','Last Name','','','','','333 W Wolf Point Plaza','https://maps.app.goo.gl/ASZMg32hRja4a7vr7','Chicago','On-Site','Registrant Address','','Open Source Sprint Event','','Make Payment','No Gateway','Please provide either a home or mobile number','Type','Preferred Class Year','Preferred First Name','False','','','','Pronouns','I am willing to receive text messages on my mobile phone about this event','Your relationship to the participant','No limit','Relationship (select all that apply)','2023-10-01','GeneralSLDS','I am...','Title','','','','','','268','','','','','','','');
